SDL_Rect getRect(int val){
    SDL_Rect rect;
    bool flag=true;
    for(int i=0;i<ROW;i++){
        for(int j=0;j<COLUMN;j++){
            if(maze[i][j]==val){
                rect.x=8*j;
                rect.y=8*i;
                flag=false;
                break;
            }
        }
        if(!flag){
            break;
        }
    }

    for(int i=0;i<COLUMN;i++){
        if(maze[rect.y/8][i] == val){
            rect.w=8*i-rect.x;
        }
    }

    for(int j=0;j<ROW;j++){
        if(maze[j][rect.x/8] == val){
            rect.h = 8*j-rect.y;
        }
    }

    return rect;
}